.
📚𝑹𝒊𝒑𝒂𝒔𝒔𝒐 𝑻𝒆𝒄𝒉𝒏𝒊𝒒𝒖𝒆: is a style of winemaking typical to Valpolicella, one of the most prestigious Italian winemaking areas in the Veneto region, which is located northwest of the ancient Roman town of Verona. The way it is done is by “re-passing” of the Valpolicella wine on the dried grape skins of Amarone when it’s still warm and rich in sugar. The Valpolicella remains in contact with the pomace of Amarone for 10/12 days; during this period, a second alcoholic fermentation occurs. It is a brilliant concept for increasing complexity,  flavors and intensity in basic Valpolicella, it is then aged for 18 months in large oak barrels. 
.
🍇𝑹𝑰𝑵𝑮𝑶 𝑽𝒂𝒍𝒑𝒐𝒍𝒊𝒄𝒆𝒍𝒍𝒂 𝑹𝒊𝒑𝒔𝒔𝒐 𝑪𝒍𝒂𝒔𝒔𝒊𝒄𝒐 𝑺𝒖𝒑𝒆𝒓𝒊𝒐𝒓𝒆 𝑫𝑶𝑪 2017 is a blend of Corvina and Rondinella, has ruby color and delightful aromas of stewed red cherries and black plum, topped with subtle spicy notes and complemented with medium acidity and high alcohol ( 14% ABV)
Pair with: Mushroom - sausage  Ragù 
This  could go on your list of good wines under $30 .
Salute🍷🍷
